<p>Pashmak decided to give Parmida a pair of flowers from the garden. There are <em>n</em> flowers in the garden and the <em>i</em>-th of them has a beauty number <em>b</em><sub class="lower-index"><i>i</i></sub>. Parmida is a very strange girl so she doesn't want to have the two most beautiful flowers necessarily. She wants to have those pairs of flowers that their beauty difference is maximal possible!</p>
